import React, { Component } from "react";
import "./Header.css";
import { Navbar, Nav } from 'react-bootstrap';

export default class Header extends Component {  
  constructor(props) {
    super(props);
    this.state = {}    
  }

  render() {
   
    return (
        // <Navbar bg="dark" variant="dark">
